Time Traveling with Brian Unger
Brian Unger goes where ordinary travellers can't, using eye-popping CGI to visually travel back in time and tell stories you won't find in guidebooks. Brian serves as the ultimate tour guide, taking locals to iconic landmarks and revealing histories we never knew.


1)  SF's Golden Gateway &amp; NY's Tallest Five and Dime 
Brian revisits the Great Depression in San Francisco, where an amazing feat of engineering resulted in the Golden Gate Bridge. Afterward, he heads to New York City to see how the first building to scrape the sky has transformed from 1913 to today.

2)  Cowboys, Cops, Corrals &amp; Divorce Vegas Style 
Brian travels back to the Wild West in Tombstone, AZ, to see where the infamous OK Corral gunfight really took place. Then, he hits the streets of 1940s Las Vegas to see &quot;divorce ranches&quot; and how celebrities such as Marilyn Monroe secretly got divorced.

3)  Monuments Man and Tramping through Hollywood 
Brian travels back in time to 1884 in Washington, DC, to see how a swamp turned into the National Mall and to learn the story behind the US Capitol's construction. Then, he takes locals tramping through Hollywood, CA, in search of the hidden filming locations and studios of Charlie Chaplin.

4)  Liberty Bell Escape and Hidden Canyon Treasures 
Brian Unger takes locals on an adventure to uncover the histories of 2 dramatically different landscapes. First, he shows them the bootlegged journey of the Liberty Bell through Pennsylvania; then, he travels to Arizona to explore the stories of the Grand Canyon's past.

5)  Lincolns Killer on the Run 
Brian takes locals back to Washington, DC, at the end of the Civil War to follow the escape route of President Lincoln's assassin, John Wilkes Booth. They hide in a pine thicket, row across the Potomac River, and visit a special group of tennis courts.

6)  Pocahontas &amp; Death Valley Scotty 
Brian and his guests &quot;travel&quot; to 1607 in Jamestown, VA, where the first English settlement was built and Pocahontas was married. Brian then heads to Death Valley, CA, to see a scam artist and learn why many flocked to the unforgiving climate in the late 1900s.

7)  Rockets Red Glare &amp; Rockin' LA Hotels 
Brian takes his guests to Baltimore to &quot;witness&quot; the most famous battle during the War of 1812 and to visit the birthplace of our national anthem. Next, he enters Hollywood and rock 'n' roll history in the old hotels of Los Angeles.

8)  Eye of the Storm, Fountain of Youth 
Brian and his &quot;time travellers&quot; visit Galveston, TX, to learn about the deadliest hurricane in US history. The group then travels to America's oldest city, St. Augustine, FL, to get a taste of life in the 1500s and search for the Fountain of Youth.

9)  AZ Diamondbacks &amp; Hohokam 
Time periods collide as Brian and locals visit the Arizona Diamondbacks' spring-training facility, where Major League Baseball meets an ancient Native American game. Brian throws the first pitch and is joined by Luis Gonzalez and Eric Byrnes.

10)  Breaking Barriers &amp; Sherman's March to the Sea 
Brian and his guests visit the Mojave Desert and learn who had &quot;the Right Stuff&quot; at Edwards Air Force Base in the 1940s. Then, they travel to Atlanta to revisit the end of the Civil War, when Gen. William Sherman made his destructive &quot;March to the Sea.&quot;



